import React, { useState, useRef } from "react";
import { FaStar, FaHandSparkles, FaBookOpen, FaGem, FaChartLine, FaComments, FaUserAstronaut, FaHeart, FaSun, FaGlobe, FaBalanceScale } from "react-icons/fa";

const allServices = [
  { name: "Daily Horoscope", icon: <FaSun />, link: "/horoscope", category: "Horoscope" },
  { name: "Weekly Horoscope", icon: <FaGlobe />, link: "/horoscope?weekly", category: "Horoscope" },
  { name: "Palmistry", icon: <FaHandSparkles />, link: "/palmistry", category: "Readings" },
  { name: "Tarot Reading", icon: <FaStar />, link: "/tarot-card", category: "Readings" },
  { name: "Numerology", icon: <FaChartLine />, link: "/numerology", category: "Readings" },
  { name: "Chat with Astrologer", icon: <FaComments />, link: "/chat-astrologer", category: "Consultation" },
  { name: "Talk to Astrologer", icon: <FaUserAstronaut />, link: "/talk-astrologer", category: "Consultation" },
  { name: "Kundli Matching", icon: <FaHeart />, link: "/kundli-matching", category: "Horoscope" },
  { name: "Gemstone Consultation", icon: <FaGem />, link: "/gem-store", category: "Consultation" },
  { name: "Vastu Consultation", icon: <FaBalanceScale />, link: "/vastu-consult", category: "Consultation" },
  { name: "Book a Pooja", icon: <FaBookOpen />, link: "/book-pooja", category: "Consultation" },
];

const categories = ["All", "Horoscope", "Readings", "Consultation"];

const AstrologyServices = () => {
  const [selectedCategory, setSelectedCategory] = useState("All");
  const categoryRef = useRef(null);

  const filteredServices =
    selectedCategory === "All" ? allServices : allServices.filter(service => service.category === selectedCategory);

  return (
    <section className="py-16 bg-gradient-to-b from-[#1A1A2E] to-[#0A0F1A] text-white">
      <div className="max-w-7xl mx-auto text-center">
        <h2 className="text-4xl font-bold bg-gradient-to-r from-[#FFB703] to-[#FB923C] text-transparent bg-clip-text">
          ðŸ”® Our Astrology Services
        </h2>
        <p className="mt-4 text-lg text-gray-400">Explore a variety of astrology services tailored for you.</p>

        {/* Scrollable Filter Buttons */}
        <div ref={categoryRef} className="flex overflow-x-auto mt-6 space-x-4 scrollbar-hide px-4">
          {categories.map(category => (
            <button
              key={category}
              onClick={() => setSelectedCategory(category)}
              className={`px-6 py-2 rounded-full transition duration-300 ${
                selectedCategory === category
                  ? "bg-gradient-to-r from-[#FFB703] to-[#FB923C] text-black shadow-lg"
                  : "bg-white/20 hover:bg-[#06B6D4] text-gray-200"
              }`}
            >
              {category}
            </button>
          ))}
        </div>
      </div>

      {/* Service Cards */}
      <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-6 max-w-7xl mx-auto mt-10 px-6">
        {filteredServices.map((service, index) => (
          <a key={index} href={service.link} className="group perspective">
            <div className="relative w-full h-48 transform transition-transform duration-500 group-hover:rotate-y-180">
              
              {/* Front Side */}
              <div className="absolute inset-0 flex flex-col items-center justify-center bg-white/10 dark:bg-gray-800/50 text-white p-6 rounded-lg shadow-lg backdrop-blur-md border border-white/20 dark:border-gray-700 transition-all">
                <div className="text-5xl bg-gradient-to-r from-[#06B6D4] to-[#9333EA] text-transparent bg-clip-text">
                  {service.icon}
                </div>
                <h3 className="mt-4 text-lg font-semibold">{service.name}</h3>
              </div>

              {/* Back Side (Flip Animation) */}
              <div className="absolute inset-0 flex flex-col items-center justify-center bg-gradient-to-r from-[#FFB703] to-[#FB923C] text-black text-lg font-semibold p-6 rounded-lg shadow-lg rotate-y-180">
                Explore {service.name} â†’
              </div>
            </div>
          </a>
        ))}
      </div>
    </section>
  );
};

export default AstrologyServices;
